require.config({"config": {
        "jsbuild":{"Magedelight_ScheduleShipping/js/shipping-save-processor-default.js":"\n/**\n * Magedelight\n * Copyright (C) 2016 Magedelight <info@magedelight.com>\n *\n * NOTICE OF LICENSE\n *\n * This program is free software: you can redistribute it and/or modify\n * it under the terms of the GNU General Public License as published by\n * the Free Software Foundation, either version 3 of the License, or\n * (at your option) any later version.\n *\n * This program is distributed in the hope that it will be useful,\n * but WITHOUT ANY WARRANTY; without even the implied warranty of\n * MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE. See the\n * GNU General Public License for more details.\n *\n * You should have received a copy of the GNU General Public License\n * along with this program. If not, see http://opensource.org/licenses/gpl-3.0.html.\n *\n * @category Magedelight\n * @package Magedelight_ScheduleShipping\n * @copyright Copyright (c) 2016 Mage Delight (http://www.magedelight.com/)\n * @license http://opensource.org/licenses/gpl-3.0.html GNU General Public License,version 3 (GPL-3.0)\n * @author Magedelight <info@magedelight.com>\n */\n\ndefine(\n    [\n        'ko',\n        'jquery',\n        'Magento_Checkout/js/model/quote',\n        'Magento_Checkout/js/model/resource-url-manager',\n        'mage/storage',\n        'Magento_Checkout/js/model/payment-service',\n        'Magento_Checkout/js/model/payment/method-converter',\n        'Magento_Checkout/js/model/error-processor',\n        'loader'\n    ],\n    function (ko, $, quote, resourceUrlManager, storage, paymentService, methodConverter, errorProcessor) {\n        'use strict';\n        return {\n            saveShippingInformation: function () {\n                $('body').trigger('processStart');\n                var deliveryfee = $('[name=\"custom-fee\"]').val();\n                if (!deliveryfee) {\n                    deliveryfee = 0;\n                }\n                ;\n\n                var deliveryCall = 0;\n                if ($('[name=\"delivery_call\"]').prop(\"checked\") == true) {\n                    deliveryCall = 1;\n                } else {\n                    deliveryCall = 0;\n                }\n\n                var payload = {\n                    addressInformation: {\n                        shipping_address: quote.shippingAddress(),\n                        shipping_method_code: quote.shippingMethod().method_code,\n                        shipping_carrier_code: quote.shippingMethod().carrier_code,\n                        extension_attributes: {\n                            delivery_date: $('[name=\"delivery_date\"]').val(),\n                            delivery_timeslot: $('[name=\"delivery_timeslot\"]').val(),\n                            delivery_comment: $('[name=\"delivery_comment\"]').val(),\n                            delivery_call: deliveryCall,\n                            fee: deliveryfee,\n                        }\n                    }\n                };\n\n                return storage.post(\n                    resourceUrlManager.getUrlForSetShippingInformation(quote),\n                    JSON.stringify(payload)\n                ).done(\n                    function (response) {\n                        $('body').trigger('processStop');\n                        quote.setTotals(response.totals);\n                        paymentService.setPaymentMethods(methodConverter(response.payment_methods));\n                    }\n                ).fail(\n                    function (response) {\n                        $('body').trigger('processStop');\n                        errorProcessor.process(response);\n                    }\n                );\n            }\n        };\n    }\n);\n  "}
}});
